import { usuarios } from '../users'

const Login = ({login,setLogin}) => {
  const [arrelgoUsuarios,setArregloUsuarios]=useState(usuarios);
  const [usuarioAux,setUsuarioAux]=useState({
      nombre:'',
      psw:''
  });
  const handleLogin=(nombre,psw)=>{
    // arrelgoUsuarios.map((user)=>{
    //     console.log(user.nombre);
    // });
    console.log("Este el nombre: ",nombre);
  }  
  return (
    <div className='container'>
        <h4>Login</h4>
        <form className='row'>
            <div className="form-floating mb-3 col">
                <input 
                    type="text" 
                    className="form-control" 
                    id="floatingInput" 
                    placeholder="usuario5"
                    onChange={(value)=>setUsuarioAux({...usuarioAux,nombre:value})}
                    />
                <label for="floatingInput">Nombre de usuario</label>
            </div>
            <div className="form-floating col">
                <input type="password" className="form-control" id="floatingPassword" placeholder="Password"/>
                <label for="floatingPassword">Password</label>
            </div>
            
        </form>
        <button type="button" class="btn btn-primary" onClick={()=>{handleLogin()}}>Acceder</button>
    </div>
  )
}

export default Login
